import "./App.css";
import allCountryScores from "./score";

function App() {
  return (
    <div className="App">
      <h1>High Score Per Country</h1>
      <MakeList />
    </div>
  );
}

function MakeList() {
  // const newA = allCountryScores.sort((a, b) => a.name.localeCompare(b.name));
  // const nameC =
  // ));

  return (
    <div>
      {allCountryScores.map((element) => (
        <ul>
          <h2>High Scores: {element.name}</h2>
          <li>{element.scores.n}</li>
        </ul>
      ))}
    </div>
  );
}

export default App;
